import React from 'react';
import classes from './BuildControl.module.css';

const buildControl = (props) => (
    <div className={props.animationCSS} onAnimationEnd={props.animationReset}>
    <div className={classes.BuildControl}>
        <div className={classes.Label}>{props.label}</div>
        <button className={classes.left}
        onClick={props.removed}
        disabled={props.disable}> - </button>
        <div className={classes.number}> {props.numIngs} </div>
        <button onClick={props.added}> + </button>
    </div>
</div>
);

export default buildControl;
